import getAnswer from './App.js'
import createSudoku  from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
let ans=getAnswer()
let count=0;
let temp=JSON.parse(JSON.stringify(sudoku));
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  func=()=>{
    root.render(<Sudoku />)
  }
  render(){
    return(
      <button className='startButton' onClick={this.func}>
        Click to Start
      </button>
    )
  }
}
class Sudoku extends React.Component{
  render(){
    return (<div className='Sudoku'>
      {sudoku.map((arr,index)=><Row arr={arr} r={index}/>)}
      </div>
    )
  }
}
class Row extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render()
  {
    return(
      <div className='row'>{
        this.props.arr.map((val,index)=>{
        if(val==-1)
        return <Input r={this.props.r} c={index}/>
        else
        return <Element val={val}/>
      })
    }
    </div>
    )
  }
}
class Input extends React.Component{
  constructor(props)
  {
    super(props)

  }
  update=(e)=>{
    let k=e.target.value;
    if(k.length>1)
    alert("invalid number")
    else
    temp[this.props.r][this.props.c]=k-(k.charCodeAt('0'))
  }

  render(){
    return <input className='Element1' type="text" onKeyUp={this.update}/>
  }
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
   return( <div className='Element'>
      {this.props.val}
    </div>)
  }
}
root.render(<Start/>)
